  // ========= NormalizaciÃ³n y tipos de vÃ­a =========

  function normalizeBase(s) {
    return (s || '')
      .toLowerCase()
      .normalize('NFD')
      .replace(/[\u0300-\u036f]/g, '')
      .replace(/\s+/g, ' ')
      .trim();
  }

  const PREPS = ['de', 'del', 'd', "d'", 'da', 'dos', 'des'];

function stripLeadingPrep(s) {
    let t = normalizeBase(s); // ya estÃ¡ en minÃºsculas, sin tildes, un espacio
    for (const p of PREPS) {
        // ^d'  o ^de  etc.
        const re = new RegExp('^' + p.replace("'", "\\'") + '\\s+', 'i');
        if (re.test(t)) {
            t = t.replace(re, '');
            break;
        }
    }
    return t.trim();
}


