  // ========= Modo 1: bÃºsqueda por calle en API =========

  function searchStreetsInAPI(term) {
    return new Promise((resolve, reject) => {
      const trimmed = (term || '').trim();
      if (!trimmed) {
        resolve([]);
        return;
      }

      const limit  = 20;
      const offset = 0;
      const where  = encodeURIComponent(`search(*,"${trimmed}")`);

      const url = `${BASE_URL}/catalog/datasets/${DATASET_STREETS}/records` +
                  `?limit=${limit}&offset=${offset}&where=${where}&lang=es`;

      GM_xmlhttpRequest({
        method: 'GET',
        url,
        headers: { 'Accept': 'application/json' },
        onload: res => {
          try {
            const data = JSON.parse(res.responseText);
            const records = Array.isArray(data.results)
              ? data.results
              : (Array.isArray(data) ? data : []);
            const out = records.map(fields => {
              const codvia  = fields.codvia;
              const nombre  = fields.nomoficial || fields.traducnooficial;
              const tipovia = fields.codtipovia || '';
              const name    = `${tipovia} ${nombre}`.trim();
              return { codvia, name, tipovia, raw: fields };
            }).filter(s => s.codvia && s.name);
            resolve(out);
          } catch (e) {
            reject(e);
          }
        },
        onerror: err => reject(err)
      });
    });
  }

