  // ========= Modo 2: vista actual (SDK) =========

  function getCurrentMapBBoxFromSdk() {
    if (!sdk || !sdk.Map) return null;

    const center = sdk.Map.getMapCenter();
    const resolution = sdk.Map.getMapResolution();
    const viewportEl = sdk.Map.getMapViewportElement();

    if (!center || !resolution || !viewportEl) return null;

    let centerLon, centerLat;
    if (Array.isArray(center)) {
      [centerLon, centerLat] = center;
    } else if (typeof center.lon === 'number' && typeof center.lat === 'number') {
      centerLon = center.lon;
      centerLat = center.lat;
    } else {
      return null;
    }

    const widthPx  = viewportEl.clientWidth  || 0;
    const heightPx = viewportEl.clientHeight || 0;
    if (!widthPx || !heightPx) return null;

    const halfWidthMeters  = (widthPx  / 2) * resolution;
    const halfHeightMeters = (heightPx / 2) * resolution;

    const metersPerDegLat = 111320;
    const metersPerDegLon = 111320 * Math.cos(centerLat * Math.PI / 180);

    const halfLatDeg = halfHeightMeters / metersPerDegLat;
    const halfLonDeg = halfWidthMeters  / metersPerDegLon;

    return {
      minLon: centerLon - halfLonDeg,
      maxLon: centerLon + halfLonDeg,
      minLat: centerLat - halfLatDeg,
      maxLat: centerLat + halfLatDeg
    };
  }

  function getVisibleSegments() {
    if (!sdk || !sdk.DataModel || !sdk.DataModel.Segments) return [];

    const bbox = getCurrentMapBBoxFromSdk();
    if (!bbox) return [];

    const { minLon, minLat, maxLon, maxLat } = bbox;
    const segs = sdk.DataModel.Segments.getAll();
    const visibles = [];

    segs.forEach(seg => {
      const geom = seg.geometry;
      if (!geom || geom.type !== 'LineString' || !Array.isArray(geom.coordinates)) return;
      let inside = false;
      for (const [lon, lat] of geom.coordinates) {
        if (lon >= minLon && lon <= maxLon && lat >= minLat && lat <= maxLat) {
          inside = true;
          break;
        }
      }
      if (inside) visibles.push(seg);
    });

    return visibles;
  }

  function getVisibleStreetNames() {
    const segments  = getVisibleSegments();
    const streetIds = new Set();
    const names     = new Map();

    if (!sdk || !sdk.DataModel || !sdk.DataModel.Segments) return names;

    segments.forEach(seg => {
      const segId = seg.id || seg.segmentId || seg;
      if (!segId) return;

      // DirecciÃ³n completa del segmento (principal + alternativas)
      const addr = sdk.DataModel.Segments.getAddress({ segmentId: segId });
      if (!addr || !addr.street) return;

      const streetId = addr.street.id;
      const mainName = addr.street.name || '';

      if (!streetId || !mainName) return;

      // Construir altNames desde addr.altStreets
      const altNames = (addr.altStreets || [])
        .map(a => (a.street && a.street.name) ? a.street.name : '')
        .filter(Boolean);

      // Guardar por streetId (para no duplicar si hay varios segmentos)
      if (!names.has(streetId)) {
        names.set(streetId, { name: mainName, altNames });
      }
    });

    return names;
}





  // Busca registros de calles para un nombre WME concreto, usando el nÃºcleo
async function fetchStreetRecordsForWmeName(wmeName) {
    const trimmed = (wmeName || '').trim();
    if (!trimmed) return [];

    // 1) Obtener tipo + nÃºcleo a partir del nombre de WME
    const { core } = detectWmeViaTypeAndCore(trimmed);

    // 2) Si por lo que sea no hay nÃºcleo, usamos el nombre entero
    const searchText = core && core.length >= 2 ? core : trimmed;

    // OJO: NO normalizamos aquÃ­, la API ya hace bÃºsqueda textual
    const limit  = 20;
    const offset = 0;
    const where  = encodeURIComponent(`search(*,"${searchText}")`);

    const url = `${BASE_URL}/catalog/datasets/${DATASET_STREETS}/records` +
                `?limit=${limit}&offset=${offset}&where=${where}&lang=es`;

    const data = await new Promise((resolve, reject) => {
        GM_xmlhttpRequest({
            method: 'GET',
            url,
            headers: { 'Accept': 'application/json' },
            onload: res => {
                try {
                    resolve(JSON.parse(res.responseText));
                } catch (e) { reject(e); }
            },
            onerror: err => reject(err)
        });
    });

    const records = Array.isArray(data.results)
        ? data.results
        : (Array.isArray(data) ? data : []);

    // Normalizamos TODOS los registros para poder comparar luego por nÃºcleo
    return records
        .map(normalizeStreetRecord)
        .filter(r => r.codvia && r.normName);
}


  // Matching WME (nombre + tipo) con lista de records normalizados
  function matchWmeStreetToRecords(wmeName, records) {
    const { codtipovia: wCodTipo, core: wCore } = detectWmeViaTypeAndCore(wmeName);
    const normCore = normalizeBase(wCore);

    if (!records.length) return { status: 'none' };

    // 1) Coincidencia EXACTA de nÃºcleo (ignora mayÃºsculas/tildes)
    const coreMatches = records.filter(r => r.coreName === normCore);

    // 1.a) Ãnica vÃ­a con ese nÃºcleo â match bueno
    if (coreMatches.length === 1) {
        const rec = coreMatches[0];
        return { status: 'good', record: rec };
    }

    // 1.b) Varias con mismo nÃºcleo â intentar desambiguar con tipo
    if (coreMatches.length > 1 && wCodTipo) {
        const typed = coreMatches.filter(r => r.codtipovia === wCodTipo);
        if (typed.length === 1) {
            return { status: 'good', record: typed[0] };
        }
        if (typed.length > 1) {
            return { status: 'ambiguous', candidates: typed };
        }
        return { status: 'ambiguous', candidates: coreMatches };
    }

    // 2) Coincidencia PARCIAL de nÃºcleo (prefijo/substring)
    const partial = records.filter(r => {
        return r.coreName.includes(normCore) || normCore.includes(r.coreName);
    });

    // 2.a) Un Ãºnico candidato parcial â lo marcamos como "partial"
    if (partial.length === 1) {
        return { status: 'partial', candidates: partial };
    }

    // 2.b) Varios parciales â ambiguo
    if (partial.length > 1) {
        return { status: 'ambiguous', candidates: partial };
    }

    // 3) Sin coincidencias razonables
    return { status: 'none' };
}

function normalizeForCompare(str) {
    if (!str) return '';
    return str
      .toLowerCase()
      .normalize('NFD').replace(/[\u0300-\u036f]/g, '') // quitar acentos
      .replace(/\./g, '')
      .replace(/\s+/g, ' ')
      .trim();
}

const WME_TYPES    = ['carrer', 'calle', 'av', 'avenida', 'paseig', 'paseo'];
const API_ES_TYPES = ['c', 'c/', 'calle', 'av', 'avda', 'avenida', 'ps', 'paseo'];
const API_VAL_TYPES= ['c', 'c/', 'carrer', 'av', 'avenida', 'ps'];

function stripType(str, typeList) {
    const n = normalizeBase(str);   // usa tu normalizeBase
    let withoutType = n;
    for (const t of typeList) {
        const nt = normalizeBase(t);
        if (withoutType.startsWith(nt + ' ')) {
            withoutType = withoutType.slice(nt.length).trim();
            break;
        }
    }
    // aquÃ­ aplicas exactamente la misma lÃ³gica que ya usas:
    return stripLeadingPrep(withoutType); // quita solo prep inicial
}


function classifyNameMatch(wmeName, apiEsName, apiCatName) {
    // Normalizar usando la misma lÃ³gica del script
    const nWme   = normalizeBase(wmeName);
    const nEs    = normalizeBase(apiEsName);
    const nVal   = normalizeBase(apiCatName);

    // Quitar tipo de vÃ­a (carrer/calle/av/...) al principio
    const VIA_WME    = ['carrer', 'calle', 'c/', 'av', 'avenida', 'avinguda', 'paseo', 'passeig', 'pg'];
    const VIA_API_ES = ['c', 'c/', 'calle', 'av', 'avda', 'avenida', 'ps', 'paseo'];
    const VIA_API_VAL= ['c', 'c/', 'carrer', 'av', 'avinguda', 'ps', 'passeig'];

    function stripViaAndPrep(normStr, viaList) {
        let s = normStr;

        // quitar tipo de vÃ­a
        for (const v of viaList) {
            const nv = normalizeBase(v);
            if (s.startsWith(nv + ' ')) {
                s = s.slice(nv.length).trim();
                break;
            }
        }

        // quitar SOLO la preposiciÃ³n inicial usando tu PREPS
        s = stripLeadingPrep(s);

        return s;
    }

    const coreWme = stripViaAndPrep(nWme, VIA_WME);
    const coreEs  = stripViaAndPrep(nEs,  VIA_API_ES);
    const coreVal = stripViaAndPrep(nVal, VIA_API_VAL);

    const matchEs  = coreEs  && coreWme === coreEs;
    const matchVal = coreVal && coreWme === coreVal;

    if (matchEs && matchVal) return 'both';
    if (matchEs)             return 'es';
    if (matchVal)            return 'val';
    return 'none';
}



